import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faGithub } from '@fortawesome/free-brands-svg-icons'
import { faLinkedin } from '@fortawesome/free-brands-svg-icons'
import { faFile } from '@fortawesome/free-solid-svg-icons'




import { css } from 'emotion'



import linkedin from "../images/linkedin.png"
import git from "../images/git.png"

const Header = () => {
    return (<div id="header" className={styles.header}>
        <a href="https://github.com/Papatiara"><FontAwesomeIcon className={styles.icons} icon={faGithub} /></a>
        <FontAwesomeIcon className={styles.icons} icon={faLinkedin} />
        <FontAwesomeIcon className={styles.icons} icon={faFile} />
    </div>

    )
}

const styles = {
    header: css`
        margin-top: 70%;
        background-color: black;
        display: flex;
        justify-content: space-around;
        width: 100%;
        height: 130px;
        @media (max-width: 1400px) {
            margin-top: 160%;

        },
    `,
    icons: css`
    color: white;
    margin-top: 2%;
    cursor: pointer;
    font-size: 86px
    `
}

export default Header;
